🚨🚨عاجل:
ظهور شائعات عن إعادة مباراة المنتخب السعودي ضد نظيره البولندي أثر مشاركة لاعب موقوف في المباراة،الخبر لايوجد له أساس من الصحه،والموقع الذي قام بنقل الخبر هو موقع وهمي ورابط خطير أرجو الحذر وتحري الدقه في الأخبار،كون منتخبنا لديه مواجهة مصيرية.

@alghamid1927 يكفي أعطاه وحده تحت الحزام 😂😂👇🏻👇🏻

- 🎙️ هيرفي رينارد :

اتمنى من مدرب بولندا الإهتمام بنظامه الغذائي بدلًا من الإستنقاص بفريقنا

